function detailPageDialog(el) {
    var data = $(el).data('detail');
    $('.clear').val('');
    $('#md-Page-detail').modal('show');

				$('#Detail-Page-Active').prop('checked', data.active);
				$('#Detail-Page-Code').val(data.code);
				$('#Detail-Page-Description').val(data.description);
				$('#Detail-Page-Icon').val(data.icon);
				$('#Detail-Page-IdParent').val(data.idParent);
				$('#Detail-Page-Name').val(data.name);
				$('#Detail-Page-Navigation').val(data.navigation);
				$('#Detail-Page-Section').val(data.section);
				$('#Detail-Page-Sort').val(data.sort);

}
